                    }
                } else {
                    alert('Geocoder failed due to: ' + status);
                }
            });
        } catch (e) {
            $.unblockUI();
            alert("Error : " + e);
        }
        //pageChange("places");
    }

    //if (window.device) {
    var placescb = function() {
        if (navigator.geolocation) {
